import { Input, PageHeader, Typography } from 'hero-design';
import React from 'react'


function Login() {

    return (
        <>
            <PageHeader title="August digital asset management" />
            <Input 
                placeholder="Please enter your user name"
                prefix="user"
                size="large"
            />
            <Input 
                placeholder="Please enter your password"
                prefix="user"
                size="large"
            />
        </>

    )
}

export default Login;
